import React, { Component } from 'react';
import {Navbar, Header, About} from './components'
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <Navbar />
      <Header />
      <main>
      <About />
      </main>
      </div>
    );
  }
}

export default App;
